BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "clientes" (
	"cliente_id"	INTEGER,
	"nome"	TEXT NOT NULL,
	"email"	TEXT NOT NULL,
	"telefone"	TEXT NOT NULL,
	"data_cadastro"	DATE NOT NULL,
	PRIMARY KEY("cliente_id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "contratos" (
	"contrato_id"	INTEGER,
	"cliente_id"	INTEGER NOT NULL,
	"veiculo_id"	INTEGER NOT NULL,
	"plano_id"	INTEGER NOT NULL,
	"data_inicio"	DATE NOT NULL,
	"data_fim"	DATE NOT NULL,
	"tipo_contrato"	TEXT NOT NULL,
	"valor_total"	REAL NOT NULL,
	PRIMARY KEY("contrato_id" AUTOINCREMENT),
	FOREIGN KEY("cliente_id") REFERENCES "clientes"("cliente_id"),
	FOREIGN KEY("plano_id") REFERENCES "planos"("plano_id"),
	FOREIGN KEY("veiculo_id") REFERENCES "veiculos"("veiculo_id")
);
CREATE TABLE IF NOT EXISTS "pagamentos" (
	"pagamento_id"	INTEGER,
	"contrato_id"	INTEGER NOT NULL,
	"valor_pago"	REAL NOT NULL,
	"valor_faltante"	REAL NOT NULL,
	"status"	TEXT NOT NULL,
	PRIMARY KEY("pagamento_id" AUTOINCREMENT),
	FOREIGN KEY("contrato_id") REFERENCES "contratos"("contrato_id")
);
CREATE TABLE IF NOT EXISTS "planos" (
	"plano_id"	INTEGER,
	"nome_plano"	TEXT NOT NULL,
	"duracao_dias"	INTEGER NOT NULL,
	"desconto_percent"	REAL NOT NULL,
	PRIMARY KEY("plano_id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "veiculos" (
	"veiculo_id"	INTEGER,
	"modelo"	TEXT NOT NULL,
	"categoria"	TEXT NOT NULL,
	"valor_dia"	REAL NOT NULL,
	PRIMARY KEY("veiculo_id" AUTOINCREMENT)
);
COMMIT;
